            if i == len(sorted_candles) - 1:
                # If we are at the end of the list, no such candle.
                time += (len(candle[1]) - 1) * (len(sorted_candles[i]) - i)
            else:
                # Find the nearest next candle.
                next_candle_index = sorted_candles[i + 1][1][0]
                time += min(candle_index - next_candle_index, next_candle_index - candle_index) * len(candle[1])
    return str(time)

