def solution(stdin: str) -> str:
    '''
    Convert a string to an array of integers and return the modified array
    Time - O(n)
    Space - O(n)
    '''
    string = stdin.split()[1]
    k = int(stdin.split()[2])

    def getMaxSum(string, k, maxLen):
        if k == 0:
            return 0

        firstIndex = 0
        lastIndex = len(string) - 1
        maxSum = 0

        while firstIndex < lastIndex:
            if maxSum < maxLen:
                if abs(int(string[firstIndex])) > abs(int(string[lastIndex])):
                    maxSum += abs(int(string[lastIndex]))
                    lastIndex -= 1
                else:
                    maxSum += abs(int(string[firstIndex]))
                    firstIndex += 1

            else:
                break

        return maxSum

    if k % 2 == 0:
        return getMaxSum(string, k, k)

    maxLen = k // 2
    maxSum = 0

    while maxLen > 0:
        maxSum = getMaxSum(string, maxLen, maxLen)
        maxLen -= 1

    return maxSum

