def solution(stdin: str) -> str:
    """
    Return "yes" if no word is repeated, and "no" if one or more words repeat.

    >>> solution("THE RAIN IN SPAIN")
    'yes'
    >>> solution("IN THE RAIN AND THE SNOW")
    'no'
    """

    words = stdin.split()
    for i in range(len(words)):
        for j in range(len(words)):
            if i == j:
                continue
            if words[i] == words[j] and i!= j:
                return "no"
    return "yes"

