    rows = N // 4
    if rows == 0:
        rows = 1

    while rows * 4 < N:
        rows += 1

    matrix = [[0 for _ in range(rows)] for _ in range(rows)]
    for row in range(rows):
        for column in range(rows):
            if row < column:
                continue

            if row * column < N:
                matrix[row][column] = message[row * column]

    for row in range(rows):
        for column in range(rows):
            if row * column < N:
                continue

            if row > column:
                continue

            matrix[column][row] = matrix[row][column]

    result = ""
    for row in range(rows):
        for column in range(rows):
            if matrix[row][column]!= 0:
                result += matrix[row][column]

    return result

